        'hide_empty' => false,
    ) );
    $section_links = array();
    $j = 0;
    foreach($categories as $category){

        $section_id = get_field('map_id','category_' . $category->term_id);

        if($category->category_parent >0 && $section_id){

        $section_links[$j]['link'] = get_category_link($category->term_id);
        $section_links[$j]['id'] = $section_id;
        $j++;

        }
    }
    unset($j);
    $section_links = json_encode($section_links);
    ?>

    <script>
        (function ($, root, undefined) {

            <?php echo "var sectionLinks = ". $section_links . ";\n"; ?>

            console.log(sectionLinks);

            for( var section of sectionLinks){

                var id = section['id']
                var link = section['link']

                var g = document.getElementById(id);
                if( g ) {
                    var parent = g.parentNode;
                    var a = document.createElementNS('http://www.w3.org/2000/svg', 'a');

                    a.setAttributeNS('http://www.w3.org/1999/xlink', 'xlink:href', link);
                    a.appendChild(g);

                    parent.appendChild(a);
                }
            }
        })(jQuery, this);
    </script>

    <?php
}